import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './components/app/App';
import NavBar from './components/nav-bar/NavBar';

ReactDOM.render(
  <React.StrictMode>
    <header>
      <NavBar />
    </header>
    <body>
      <App />
    </body>
  </React.StrictMode>,
  document.getElementById('main-butacorp-context'));
